  [],\n\t\"revision_timestamp\": \"2015-05-07T00:36:08.385061\",\n\t\"name\": \"aqua-airs-level-3-pentad-quantization-in-physical-units-airsamsu-v006\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"AIRS/Aqua Level 3 pentad quantization product
  in physical units (Without HSB).n      nThe geophysical parameters have been averaged
  and binned into 1 x 1 deg grid cells, from -180.0 to +180.0 deg longitude and from
  -90.0 to +90.0 deg latitude. For each grid map of 4-byte floating-point mean values
  there is a corresponding 4-byte floating-point map of standard deviation and a 2-byte
  integer grid map of counts. The counts map provides the user with the number of
  points per bin that were included in the mean and can be used to generate custom
  multi-day maps from the daily gridded products.n      nThe thermodynamic parameters
  are: Skin Temperature (land and sea surface), Air Temperature at the surface, Profiles
  of Air Temperature and Water Vapor, Tropopause Characteristics, Column Precipitable
  Water, Cloud Amount/Frequency, Cloud Height, Cloud Top Pressure, Cloud Top Temperature,
  Reflectance, Emissivity, Surface Pressure, Cloud Vertical Distribution. nnThe trace
  gases parameters are: Total Amounts and Vertical Profiles of Carbon Monoxide, Methane,
  and Ozone.nnThe actual names of the variables in the data files should be inferred
  from the Processing File Description document.nn(The Shortname for this product
  is AIRX3QP5).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
